DROP TABLE IF EXISTS `forum_threads`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `forum_threads` (
  `thread_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` bigint(20) unsigned NOT NULL,
  `addon_id` bigint(20) unsigned NOT NULL COMMENT 'ID дополнения, о котором пойдет речь в теме форума',
  `thread_type_id` bigint(20) unsigned NOT NULL COMMENT 'ID типа треда',
  `theme` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Заголовок темы',
  `description` varchar(10000) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Описание проблемы',
  `attachment` blob DEFAULT NULL COMMENT 'Вложение',
  PRIMARY KEY (`thread_id`),
  KEY `user_id` (`user_id`),
  KEY `addon_id` (`addon_id`),
  KEY `thread_type_id` (`thread_type_id`),
  CONSTRAINT `forum_threads_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `users` (`user_id`),
  CONSTRAINT `forum_threads_ibfk_2` FOREIGN KEY (`addon_id`) REFERENCES `addons` (`addon_id`),
  CONSTRAINT `forum_threads_ibfk_3` FOREIGN KEY (`thread_type_id`) REFERENCES `thread_types` (`thread_id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
